import React from "react";
import { NavLink } from "react-router-dom";

const NavBar = ({user, logout}) => {
  return (
    <div className="navbar">
      <NavLink to="/" exact>
        Character Select
      </NavLink>
      <NavLink to="/about" exact>
        About
      </NavLink>
      <NavLink to="/encounter-1" exact>
        Into The Trungeon!
      </NavLink>
      <NavLink to="/" exact  onClick={logout}></NavLink>
    </div>
  );
};

export default NavBar;
